import React from 'react';

export default function Consulting() {
  return (
    <>
      <h1 className='consulting'>Qui sommes-nous</h1>
      <h2>Bienvenue sur Hoopfinder - votre destination ultime pour découvrir les terrains de basket locaux ! Notre mission est de connecter les passionnés aux courts à proximité, ce qui vous permet de jouer, de vous entraîner et d'embrasser l'esprit du jeu plus facilement. Faisons le saut ensemble !</h2>
    </>
  );
}
